import * as ReactFinder from "react-finderjs";


function TreeView() {
    var container = document.getElementById('container');
    var data = [
      {
        label: 'Item 1',
        children: [
          {
            label: 'Item 1A',
            children: [
              {
                label: 'Item 1A1'
              }
            ]
          },
          {
            label: 'Item 1B'
          }
        ]
      }
    ];
        var options = {};

        var f = ReactFinder(container, data, options);

        f.on('leaf-selected', function(item) {
          console.log('Leaf selected', item);
        });


}

export default TreeView;
